import ProductList from "../components/ProductList"

export default function Shop({
  products,
  onAdd,
  wishlist,
  onToggleWishlist,
}) {
  return (
    <>
      <h2>Shop</h2>
      <ProductList
        products={products}
        onAdd={onAdd}
        wishlist={wishlist}
        onToggleWishlist={onToggleWishlist}
      />

      <FilterSidebar />

    </>
  )
}
